function priceFormatter(value, row) { "use strict"; if (value !== '' && value.includes('$')) { return '<div data-toggle="tooltip" title="' + value + '">' + (value.replace('$','') * usd).toFixed(0) + '&nbsp;₴</div>'; } else if (value !== '' && value.includes('€')) { return '<div data-toggle="tooltip" title="' + value + '">' + (value.replace('€','') * eur).toFixed(0) + '&nbsp;₴</div>'; } else if (value === '' && row.price_sqmt !== '') { if (row.price_sqmt !== '' && row.price_sqmt.includes('$')) { return '<div data-toggle="tooltip" title="' + row.price_sqmt + '">' + (row.price_sqmt.replace('$','') * usd).toFixed(0) + '&nbsp;₴</div>'; } else if (row.price_sqmt !== '' && row.price_sqmt.includes('€')) { return '<div data-toggle="tooltip" title="' + row.price_sqmt + '">' + (row.price_sqmt.replace('€','') * eur).toFixed(0) + '&nbsp;₴</div>'; } else if (row.price_sqmt !== '') { return '<div data-toggle="tooltip" title="$' + (row.price_sqmt / nbu).toFixed(0) + '">' + (row.price_sqmt*1).toFixed(0) + '&nbsp;₴</div>'; } } else { return '<div data-toggle="tooltip" title="$' + (value / nbu).toFixed(0) + '">' + (value*1).toFixed(0) + '&nbsp;₴</div>'; } }
function priceSorter(a, b) { let s = /[$€₴]/g; var aa = a.replace(s, ''), bb = b.replace(s, ''); return aa - bb }
